import React, {Component} from 'react';
import {Container, Dropdown, Image, Menu} from 'semantic-ui-react'
import Link from 'next/link';
import Head from "next/head";


class Index extends Component {


    render() {
        return (

            <div>
                <div>

                    <Menu fixed='top'>
                        <Container textAlign='center'>
                            <Link href="/index">
                                <Menu.Item as='a' header>
                                    <Image size='normal'
                                           src='https://img.icons8.com/ultraviolet/50/000000/parse-resumes.png'
                                           style={{marginLeft: '1.5em'}}/>
                                    <h2 style={{margin: '5px'}}>Resume Verifier</h2>
                                </Menu.Item>
                            </Link>
                            <Dropdown item simple text='Manage Cars'>
                                <Dropdown.Menu>
                                    <Link href="/index">
                                        <Dropdown.Item as='a'>Register</Dropdown.Item>
                                    </Link>
                                    <Link href="/index">
                                        <Dropdown.Item as='a'>Admin</Dropdown.Item>
                                    </Link>
                                    <Link href="/index">
                                        <Dropdown.Item as='a'>Request</Dropdown.Item>
                                    </Link>
                                    }


                                </Dropdown.Menu>
                            </Dropdown>
                        </Container>

                    </Menu>

                </div>
                <Head>
                    <link
                        rel="stylesheet"
                        href="//cdnjs.cloudflare.com/ajax/libs/semantic-ui/2.2.11/semantic.min.css"
                    />
                    <style>{`
        body {
         background: url("https://images.pexels.com/photos/707047/pexels-photo-707047.jpeg?auto=compress&cs=tinysrgb&dpr=2&h=1280&w=1900");
         background-repeat: no-repeat;
         background-position: center; 
         background-attachment: fixed;
        }
      `}</style>
                </Head>
            </div>

        );
    }
}

export default Index;
